class Titulo extends Component{
    render(){
        return(
            <div>
                <dr>Concepto</dr>
                <dr>Monto</dr>
                <dr>Tipo</dr>
                <dr>Categorida</dr>
            </div>
        )
    }
}
export default Titulo;
